  Sequelize,
  DataTypes
} = require('sequelize');
module.exports = (sequelize, DataTypes) => {
  const Product = sequelize.define('Product', {
    name: {
      type: DataTypes.STRING,
      allowNull: false
    },
    quantity: {
      type: DataTypes.INTEGER,
      allowNull: false
    }
  }, {});
  Product.associate = model => {
    Product.belongsTo(model.User);
  };
  return Product;
};
