const { Sequelize, DataTypes } = require('sequelize');


module.exports = (sequelize, DataTypes) => {
    const Product = sequelize.define('Product', {
        name: {
            type: DataTypes.STRING,
            allowNull: false,
        },
        quantity: {
            type: DataTypes.INTEGER,
            allowNull: false,
        }
    }, {}
    )

    Product.getSearchVector = () => {
        return 'ProductText';
    },

    Product.addFullTextIndex = () => {
        if(sequelize.options.dialect !== 'postgres') {
            console.log('Not creating search index, must be using POSTGRES to do this');
            return;      
        }

        var searchFields = ['name', 'quantity'];
        // var product_instance = Product;
        var product_instance = "products_users_joined";

        var vectorName = product_instance.getSearchVector();
        sequelize
        .query('ALTER TABLE "' + product_instance.tableName + '" ADD COLUMN "' + vectorName + '" TSVECTOR')
        .then(function() {
            return sequelize
                    .query('UPDATE "' + product_instance.tableName + '" SET "' + vectorName + '" = to_tsvector(\'english\', ' + searchFields.join(' || \' \' || ') + ')')
                    .catch((error) => console.log(error));
        }).then(function() {
            return sequelize
                    .query('CREATE INDEX product_search_idx ON "' + product_instance.tableName + '" USING gin("' + vectorName + '");')
                    .catch((error) => console.log(error));
        }).then(function() {
            return sequelize
                    .query('CREATE TRIGGER product_vector_update BEFORE INSERT OR UPDATE ON "' + product_instance.tableName + '" FOR EACH ROW EXECUTE PROCEDURE tsvector_update_trigger("' + vectorName + '", \'pg_catalog.english\', ' + searchFields.join(', ') + ')')
                    .catch((error) => console.log(error));
        }).catch((error) => console.log(error));        
    },

    Product.search = (query) => {
        if(sequelize.options.dialect !== 'postgres') {
            console.log('Search is only implemented on POSTGRES database');
            return;
        }

        // var product_instance = Product;
        var product_instance = "products_users_joined";

        query = sequelize.getQueryInterface().queryGenerator.escape(query);
        console.log(query);

        return sequelize
                .query('SELECT * FROM "' + product_instance.tableName + '" WHERE "' + product_instance.getSearchVector() + '" @@ plainto_tsquery(\'english\', ' + query + ')', product_instance);
    },

    Product.createView = () => {
        if(sequelize.options.dialect !== 'postgres') {
            console.log('Not creating view, must be using POSTGRES to do this');
            return;
        }
        sequelize.query('CREATE VIEW products_users_joined AS \
            SELECT "name", "quantity", "Users"."username" \
            FROM "Products" \
            INNER JOIN "Users" \
            ON "Products"."UserId" = "Users".id;'
        ).then((result) => { 
            return(result)
        }).catch((error) => console.log(error));

    },

    Product.associate = (model) => {
        Product.belongsTo(model.User);
    };

    return Product;
}

